renderHTML:
__ht__function(data, gv, cache) {if (!cache.htmlView) {
        var div = cache.htmlView = document.createElement('div');
        var video = document.createElement('video');
        var source = document.createElement('source');
        source.setAttribute("type","application/x-mpegURL");
        video.setAttribute("controls","controls");
        video.setAttribute("autoplay","autoplay");
        video.setAttribute("id","example-video");
        video.classList.add("video-js", "vjs-default-skin");
        video.setAttribute("width",265);
        video.setAttribute("height",225);
        video.setAttribute("style", "width: 100%;height: 100%;");
        div.appendChild(video);
        video.appendChild(source);
        div.layoutHTML = function() {
            gv.layoutHTML(data, div);
        };
        div.onHTMLAdded = function() {
            gv.firePropertyChange('videoLayout', 1, 2);
        };
    }
    return cache.htmlView;}
